import React, { Component } from 'react'

class Clients extends Component {
  render() {

    const clients = [{
      id: "453473957",
      firstName: 'Kevin',
      lastName: 'Johnson',
      email: 'kevin@gmail.com',
      phone: '555-555-5555',
      balance: '30'
    }];

    if (clients) { 
      return (
        <div>
          <h1>Clients</h1>
        </div>
      );
    } else {
      return <h1>Loading...</h1>
    }
  }
}

export default Clients;
